    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 NOT IN ( + 15, - 90 + + col1 - + + col2 * - + 91, - - 30 );
  - name: tab0

outputs:
  - name: q7895.out
    data: |
      15	81	47
      87	21	10
      97	1	99
